    false,nt"url": null,nt"notes": "This report provides a detailed summary
    of the baseline wilderness character assessment completed for the Wolf Island National
    Wildlife Refuge Wilderness, located in Georgia. The purpose of this report is multi-dimensional.
    It establishes a wilderness character monitoring program for the Wolf Island Wilderness
    and provides baseline data for future trend analysis. An understanding of the information
    in this report may also aid resource specialists by informing management decisions
    within the Wolf Island Wilderness. Finally, this report is meant to accompany and
    explain the quantitative results of Wolf Island wilderness character assessment
    that have been entered into a national wilderness character monitoring database.
     A total of 18 measures were used to assess the following: untrammeled quality,
    natural quality, undeveloped quality, and solitude or primitive and unconfined recreation
